import React from "react";
import Product from "../components/Product";

const Home = (props) => {
  const products = props.products;
  console.log("logging in hoime", products);
  return (
    <div className="flex justify-center  bg-slate-500 h-[100vh]">
      <div className="w-[80%] bg-blue-300 flex flex-wrap ">
        {products.map((data) => (
          <Product key={data.id} data={data} />
        ))}
      </div>
    </div>
  );
};

export default Home;
